function InsightSave() {
  const { callData, data, setUserData } = useInsightState('save');
  const { trans } = useTrans();

  useEffect(() => {
    callData();
    console.log(data)
  }, [trans]);
  
  useEffect(() => {
    console.log('Updated data:', data);
  }, [data]);
  return (
    <>
      <Showsave data={data} />
    </>
  );
}

export default InsightSave;
